var keyPad = [
  [1, 2, 3],
  [4, 5, 6],
  [7, 8, 9]
]

var position = [1, 1]

function processLine (startPos, line) {
  return line.split("").reduce((pos, dir) => {
    switch (dir) {
      case "U":
        pos[0] -= 1
        break;
      case "R":
        pos[1] += 1
        break;
      case "D":
        pos[0] += 1
        break;
      case "L":
        pos[1] -= 1
        break;
    }
    if (pos[0] < 0) pos[0] = 0

    if (pos[0] > 2) pos[0] = 2

    if (pos[1] < 0) pos[1] = 0

    if (pos[1] > 2) pos[1] = 2
    return pos
  }, startPos)
}

// console.log(processLine([1, 1], "ULL"))

var theCode = []

input.forEach((line) => {
  var newPosition = processLine(position, line)
  console.log(newPosition)
  theCode.push(newPosition.slice(0))
})

console.log(theCode)

function getNum (pos) {
  return keyPad[pos[0]][pos[1]]
}

console.log(theCode.map(getNum))